function Lose () {
    Hero.destroy(effects.spray, 100)
    game.over(false, effects.dissolve)
}
function Win () {
    info.stopCountdown()
    Villain.destroy(effects.spray, 100)
    game.over(true, effects.confetti)
}
function VillainLocation () {
    Villain.setPosition(Math.randomRange(15, 150), Math.randomRange(15, 120))
    pause(500)
}
